import React from "react";
import { Card } from "react-bootstrap";

const PortfolioCard = () => (
  <Card className="mb-4">
    <Card.Img src="https://via.placeholder.com/720x250" alt="Card image" />
    <Card.ImgOverlay />
    <Card.Title>Census Academy</Card.Title>
    <Card.Text>
        Hacking bureaucracy for better data science education with the U.S. Census Bureau & Coding it Forward.in to
        additional content. This content is a little bit longer.
    </Card.Text>
  </Card>
);

export default PortfolioCard;
